import React, { Component } from 'react';
import CardList from './components/CardList';

export default class App extends Component {
  state = {
    input: '',
    users: [
      { id: 1, name: 'tyroo', about: 'hi I am tyroo', age: 27 },
      { id: 2, name: 'Tansu', about: 'hi I am Tansu', age: 24 },
      { id: 3, name: 'Jonathan', about: 'hi I am Jonathan', age: 23 }
    ]
  };
  handleOnChange = event => {
    this.setState({
      formInput: event.target.value
    });
  };

  handleSubmit(event) {
    event.preventDefault();
  }

  render() {
    console.log('STATE:', this.state);
    return (
      <div className="App">
        <form action="">
          <input type="text" />
          <input type="submit" />
        </form>
        <CardList users={this.state.users} />
      </div>
    );
  }
}
